export default function CheckOut({ price }) {
    const tax = (price * 0.15).toFixed(2)
    const total = (price + price * 0.15).toFixed(2)
    return (
        <div>
            <span className="price">Subtotal: {price}</span>
            <span className="tax">Tax: {tax}</span>
            <span className="total">Total: {price + price * 0.15}</span>
        </div>
    )
}
